.
Darius the Dragon is one of the many magical creatures that are part of the Amigurumi Island fairytale!
Swipe through the pictures to discover all the fantastic characters created by your favorite crochet designers!

Get this exclusive bundle for only $32.66 (€29.99).
The discounted price will be available only until July 23rd.

Purchasing the bundle you’ll enter a GIVEAWAY and get the chance to win fantastic prizes!

10% of the profit will be donated to @unicef 

