Fall is around the corner!
This means that the most magical and spooky night of the year is coming soon!
Let’s get ready for it and have fun working on some amazing Halloween projects together with great crochet designers!

To participate in the #calloween follow these steps:

• Follow all the designers:
@amourfou_crochet @meow.amigurumi
@bluubunnycrochet
@_tejeresdeguapas_
@_funny.hook_
@kalu.crochet
@rnata6744
@elisascrochet
@amigurumistassia

• Post the first image of this post on your IG page using the hashtag #calloweenamigurumi

• Request access to the account @calloween_amigurumi 

So, grab your yarn and hook and be ready for a super fun journey starting on Sept 18th!!
